  false,\n\t\"url\": null,\n\t\"notes\": \"Milford lab maintains data sets relating
  to a variety of growth and physiology trials.  These include husbandry techniques
  (i.e. stocking density, container size, change frequency, feed delivery method)
  of various bivalve species such as the Eastern oyster (Crassostrea virginica) and
  the bay scallop (Argopecten irradians).  Data sets also cover experiments which
  have looked at effects of climate change (food availability and CO2 concentration)
  on growth and survival of surfclams (Spissula solidissima), bay scallops, and sea
  scallops.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"temporal-extent-begin\",\n\t\t\"value\":
